import {Link} from "react-router-dom";

function Header() {
    return (
        <>
            <ul>
                {
                    <li>
                        <Link to='/'>'Home'</Link>
                        <Link to='/create'>Add Restaurant</Link>
                        {/* <Link to='/edit'>Edit Restaurant</Link> */}
                    </li>
                }
            </ul>
        </>
    );
}

export default Header;
